import React from "react";

import classes from "./MyTable.module.css";

const MyTable = ({ fulldata }) => {
	if (!fulldata || fulldata.length === 0) return <p>Нет данных</p>;

	const data = Object.keys(fulldata[0]);
	// console.log(data)

	return (
		<div className={classes.container}>
			<table className={classes.table}>
				<thead className={classes.table__header}>
					<tr>
						{data.map((key) => (
							<td key={key}>{key}</td>
						))}
					</tr>
				</thead>
				<tbody className={classes.table__body}>
					{fulldata.map((obj, index) => (
						<tr key={index}>
							{data.map((key) => (
								<td key={key}>{obj[key]}</td>
							))}
						</tr>
					))}
				</tbody>
			</table>
		</div>
    );
};

